"  <div id=\"topicTitle\">",
"   Epidemiology and pathogenesis of gynecomastia",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?6/9/6294/contributors\">",
