var title_f6_9_6295="Spread of sz by type";
var content_f6_9_6295=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F76510&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F76510&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 522px\">",
"   <div class=\"ttl\">",
"    Seizure types and potential routes of spread",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 502px; height: 461px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Coronal brain sections depicting seizure types and potential routes of seizure spread.",
"    <strong>",
"     Panel A)",
"    </strong>",
"    Focal area of hyperexcitability (star under electrode 3) and spread to adjacent neocortex (solid arrow under electrode 4), via corpus callosum (dotted arrow) or other commissural pathways to the contralateral cerebral hemisphere, or via subcortical pathways (eg, thalamus, upward dashed arrows). Accompanying EEG patterns show brain electrical activity under electrodes 1-4. Focal epileptiform activity is maximal at electrode 3 and is also seen at electrode 4 (left traces). If a seizure secondarily generalizes, activity may be seen synchronously at all electrodes, after a delay (right traces).",
"    <strong>",
"     Panel B)",
"    </strong>",
"    A primary generalized seizure begins simultaneously in both hemispheres. The characteristic bilateral synchronous \"spike-wave\" pattern on EEG is generated by reciprocal interactions between the cortex and thalamus, with rapid spread via corpus callosum (CC) contributing to the rapid bilateral synchrony. One type of thalamic neuron (dark neuron) is a GABAergic inhibitory cell that displays intrinsic pacemaker activity. Cortical neurons (open triangles) send impulses to both thalamic relay neurons (open diamond) and to inhibitory neurons, setting up oscillations of excitatory and inhibitory activity, which gives rise to the rhythmic spike-waves on EEG.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Stafstrom, CE. An introduction to seizures and epilepsy: cellular mechanisms underlying classification and treatment. In: Epilepsy and the Ketogenic Diet, Stafstrom, CE, Rho, JM (Eds), Humana Press, Totowa, New Jersey 2004. p.6. Copyright &copy; 2004 Springer-Verlag.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
