var title_f6_9_6301="Drug therapy NAS";
var content_f6_9_6301=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F85854&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F85854&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Drug therapy for neonatal abstinence syndrome (NAS)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\" class=\"container\">",
"     <tbody>",
"      <tr>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1\" colspan=\"5\">",
"            Initial opioid therapy",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle2\">",
"            Drug",
"           </td>",
"           <td class=\"subtitle2\">",
"            Initial dose",
"           </td>",
"           <td class=\"subtitle2\">",
"            Incremental increase based on symptoms",
"           </td>",
"           <td class=\"subtitle2\">",
"            Maximum dose",
"           </td>",
"           <td class=\"subtitle2\">",
"            Weaning based on abstinence scoring",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Morphine",
"           </td>",
"           <td>",
"            <p>",
"             0.04 mg/kg every three to four hours given orally",
"            </p>",
"            <p>",
"             Oral dose should be given with feeds",
"            </p>",
"           </td>",
"           <td>",
"            0.04 mg/kg per dose",
"           </td>",
"           <td>",
"            0.2 mg/kg per dose",
"           </td>",
"           <td>",
"            <p>",
"             Taper dose by 10 to 20 percent every two to three days",
"            </p>",
"            <p>",
"             Discontinue morphine when the dose is weaned to 0.04 mg/kg per day without any increase in abstinence scores",
"            </p>",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Methadone",
"           </td>",
"           <td>",
"            0.05 to 0.1 mg/kg every six hours given orally",
"           </td>",
"           <td>",
"            0.05 mg/kg per dose",
"           </td>",
"           <td>",
"            To effect",
"           </td>",
"           <td>",
"            <p>",
"             Taper dose by 10 to 20 percent per week",
"            </p>",
"            <p>",
"             Discontinue when a dose of 0.05 mg/kg per day is reached",
"            </p>",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1\" colspan=\"5\">",
"            Phenobarbital used in combination with opioid therapy for infants with severe NAS or with multidrug exposure",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle2\">",
"            &nbsp;",
"           </td>",
"           <td class=\"subtitle2\">",
"            Loading dose",
"           </td>",
"           <td class=\"subtitle2\">",
"            Maintenance dose",
"           </td>",
"           <td class=\"subtitle2\">",
"            Therapeutic plasma goal",
"           </td>",
"           <td class=\"subtitle2\">",
"            Weaning",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            <strong>",
"             Phenobarbital",
"            </strong>",
"           </td>",
"           <td>",
"            <p>",
"             Single loading dose of 15 to 20 mg/kg given orally, intravenously or intramuscularly.&nbsp;If symptoms are still severe 8 to 12 hours after initial&nbsp;dose, the dose can be repeated once (total cumulative maximum loading of 40 mg/kg).",
"            </p>",
"           </td>",
"           <td>",
"            <p>",
"             3 to 4 mg/kg per day started 12 to 24 hours after initial dose",
"            </p>",
"            <p>",
"             Administered as a single dose in the evening OR two divided doses given every 12 hours",
"            </p>",
"            <p>",
"             Increase dose by 1 to 5 mg/kg per day until therapeutic plasma levels are achieved",
"            </p>",
"           </td>",
"           <td>",
"            Therapeutic goal of trough plasma concentration level between 20 and 30 mg/dL (86 and 129 micromoles/L), obtained 24 to 48 hours after initiation or change in dosing",
"           </td>",
"           <td>",
"            <p>",
"             Phenobarbital should be weaned after morphine&nbsp;is fully tapered off",
"            </p>",
"            <p>",
"             Taper phenobarbital dose to decrease drug concentration by 10 to 20 percent per day",
"            </p>",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br/>",
"     <ol>",
"      <li>",
"       Hudak ML, et al. Neonatal drug withdrawal. Pediatrics 2012; 129:e540.",
"      </li>",
"      <li>",
"       Bio LL, Siu A, Poon CY. Update on the pharmacologic management of neonatal abstinence syndrome. J Perinatol 2011; 31:692.",
"      </li>",
"      <li>",
"       Tran JH. Treatment of neonatal abstinence syndrome. J Pediatr Health Care 1999; 13:295.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
