var title_f6_9_6302="TG LDL HDL and coronary risk";
var content_f6_9_6302=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F67263&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F67263&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 544px\">",
"   <div class=\"ttl\">",
"    Hypertriglyceridemia as a risk factor for coronary heart disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 524px; height: 301px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Data from the Helsinki Heart Study, a randomized primary prevention trial in dyslipidemic men, showing the incidence of coronary events at five years according to the baseline serum triglyceride concentration and the LDL-to-HDL cholesterol ratio. The risk was markedly increased in patients with both a triglyceride concentration above 2.3 mmol/L [200 mg/dL]) and an elevated LDL-to-HDL ratio. A beneficial effect of gemfibrozil to lower the incidence of coronary events was limited to this group.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Manninen, V, Tenkanen, L, Koskinen, P, et al, Circulation 1992; 85:37.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
