"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Nipple retraction occurs when only a part of the nipple is drawn in because it is tethered by a single duct, resulting in a slit-like appearance.",
